import React from "react";
import styled from 'styled-components'

const Wrapper = styled.div`
    width: 100%;
    height: 64px;
    display: flex;
    justify-content: center;
    align-items: center;
    background-color: #c000d9;
    color: #fff;
    font-size: 20px;
    font-weight: 300;
`

export const Header = () => {
    return <Wrapper>Сомневаетесь? Протестируйте до 30 дней бесплатно!
        Попробовать</Wrapper>
}
